import logo from './logo.svg';
import header_img from './header_img.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <div style={{
          backgroundImage: `url(${require('./header_img.jpg')})`,
          backgroundPosition: 'center',
          backgroundSize: 'cover',
          backgroundRepeat: 'no-repeat',
        }}>
          <h1>LAWrgMiner Project</h1>
        </div>
        <img src={header_img} alt={'Ai'}/>
      </header>
    </div>
  );
}

export default App;
